eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"render\", function() { return render; });\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"staticRenderFns\", function() { return staticRenderFns; });\nvar render = function () {var _vm=this;var _h=_vm.$createElement;var _c=_vm._self._c||_h;return _c('VueRemarkRoot',[_c('RoboAcademyText',{attrs:{\"fWeight\":\"500\"}},[_vm._v(\"\\n  Einführung: \\\"Die Geschichte eines Mädchens namens Trinity\\\"\\n\")]),_c('p',[_vm._v(\"Die Mythologie des antiken Griechenlands ist in zwei große Zyklen unterteilt: die Zeit, als die olympischen Götter die Welt der Menschen beherrschten, und eine spätere Zeit, in der der Lebensweg der Helden vom Schicksal vorbestimmt ist, zum Beispiel Troja oder die Legende von Oedipus. In meinem Leben lief zuerst alles nach dem zweiten Szenario - mein Vater nannte mich bei meiner Geburt Trinity, und mit 20 folgte ich einer Art weißem Kaninchen.\")]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"escape-from-black-mirror/Olympus_Troy_The_Tales_of_Oedipus.png\",\"alt\":\"Olympus Troy The Tales of Oedipus\"}}),_c('p',[_vm._v(\"Das Kaninchenloch brachte mich zurück nach Megapolis, aber aus der Perspektive des Dateninformationsbusses. Dort, in den unterirdischen Rechenzentren, fand ich Beweise für die Existenz von Göttern, ähnlich den griechischen Göttern in ihrer Selbstgefälligkeit, Launen und Wünschen!\")]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"escape-from-black-mirror/Gods-datacenter.png\",\"alt\":\"Gods datacenter\"}}),_c('p',[_vm._v(\"Vor einigen Jahren fand ich einen völlig vergessenen verwundbaren Zugangspunkt zur Hauptverkehrsader der Stadt. Ich hatte eine Tür zu einer seltsamen Welt aus transparentem, lesbarem und bearbeitbarem Programmcode für das grundlegende Kommunikationsprotokoll der gesamten Megacity. Programmcode, der mich dazu brachte, Kameras abzufangen, Türschlösser ohne Wissen der Besitzer zu kontrollieren und sogar die dynamische Wasserqualitätsregelung in den Küchenarmaturen einzelner Häuser zu verdammen. Nachdem ich all das gesehen hatte, wurde ich von einer schrecklichen Angst erfüllt. Angst, dass all dies absichtlich aus der Sicht der Interessen einer anderen Person in dieser Welt geschah. Ich kann nicht sagen, dass es eine große böse Silhouette hinter all diesen Änderungen im Protokollcode gibt, aber im Laufe der Jahre der Beobachtung aus dem Hintergrund bin ich zu dem Schluss gekommen, dass Hunderte von Menschen mit unterschiedlichen Interessen direkten Zugang zum Kern haben. Egal wie sehr ich versuchte, zumindest einen dieser privilegierten Benutzer zu finden, blieb mir nur abgefangener kryptografischer Ausführungsnachweis, aber kein Sender-Schlüssel, keine Spuren, die mich zur Wahrheit führen könnten.\")]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"escape-from-black-mirror/hacking.png\",\"alt\":\"Gods hackers stayed in circle\"}}),_c('p',[_vm._v(\"Jetzt bin ich ein Netrunner, der sich auf die Bereitstellung von Cybersicherheit und Datenschutz im persönlichen Raum eines Kunden spezialisiert hat. Ich bin ein Spezialist, der dabei helfen wird, externe Kontrolle über Ihr Zuhause, Büro oder Auto zu vermeiden, selbst wenn das Signal vom autonomen Kern der Megapolis kommt.\")]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"escape-from-black-mirror/Trinnity.png\",\"alt\":\"Trinity in underground datacenter\"}}),_c('p',[_vm._v(\"Um meine Hilfe in Anspruch zu nehmen, müssen Sie einen Vertrag auf dem Satoshi Square veröffentlichen und dann digitales Gold an die Vertragsadresse überweisen. Danach werde entweder ich oder einer der überprüften Fachleute den Akt des Durchtrennens des digitalen Duplikats der Wolke vom realen Objekt in der physischen Welt durchführen. Unter uns nennen wir diesen Akt der Wiedergeburt mit dem Durchtrennen der Nabelschnur. Jetzt sind Sie eine wichtige freie Person! Sie müssen sich keine Sorgen machen, dass jemand Ihr Start-up durch eine Aufnahme aus dem Schlafzimmer, in dem Sie sich zu einem Foto Ihrer Schwester mit einer Ledermaske masturbieren, durchbricht. Sie können ruhig mit einem Freund aus Kalifornien über Politik diskutieren, während Sie ein Kongressabgeordneter aus Texas sind. Sie können mit Ihren Kindern über diese Welt sprechen, nicht aus einem Lehrbuch, und müssen nicht befürchten, dass Ihre elterlichen Rechte entschieden werden.\")]),_c('p',[_vm._v(\"Erinnern Sie sich, als ich Ihnen sagte, dass ich von Angst überwältigt war, nachdem ich alles realisiert hatte? Ich dachte, der Rest meines Lebens sei ein Puppentheater von jemand anderem. Aber die Arbeit als Netrunner hat mich vor einer tiefen Depression gerettet, obwohl ich die Wahrheit über diese seltsamen irdischen Götter nie aufgedeckt habe. Anstatt Depression beschloss ich, mich zu freuen, wenn ich jemandem Einflussreichen, Wohlhabenden oder einfach nur Besorgten helfen kann, eine unfreiwillige Beteiligung an einer weiteren Staffel des Dramas von CyberDionysus zu vermeiden.\")])],1)}\nvar staticRenderFns = []\n\n\n\n//# sourceURL=webpack:///./courses/de/learn/escape-from-black-mirror/overview.md?./node_modules/cache-loader/dist/cjs.js?%7B%22cacheDirectory%22:%22node_modules/.cache/gridsome%22,%22cacheIdentifier%22:%223ec475f9-vue-loader-template%22%7D!./node_modules/gridsome/node_modules/vue-loader/lib/loaders/templateLoader.js??vue-loader-options!./node_modules/gridsome/node_modules/vue-loader/lib??ref--17-0!./node_modules/@gridsome/vue-remark/lib/loader.js??ref--17-1");

